#include <iostream>
#include <string>
using namespace std;
/*

*/
int main() {	

   string a, b;
   cin >> a >> b;
   a.shrink_to_fit();
   b.shrink_to_fit();
   short n, m;
   n = a.length();
   m = b.length();

   string * d1 = new string [m + 1];
   string * d2 = new string [m + 1];

   for (short i = 0; i < m + 1; ++i) {
      d1[i].clear();
      d2[i].clear();
   }

   for (short i = 1; i <= n; ++i) {
      for (short j = 1; j <= m; ++j) {
         if (a[i - 1] == b[j - 1]) {
            d1[j - 1].push_back(a[i - 1]);
            d2[j] = d1[j - 1];
            d1[j - 1].clear();
            d1[j - 1].shrink_to_fit();
         }
         else
            if (d1[j].length() > d2[j - 1].length()) {
               d2[j] = d1[j];
            }
            else {
               d2[j] = d2[j - 1];
            }

         d2[j].shrink_to_fit();
         d1[j - 1] = d2[j - 1];
         d2[j - 1].clear();
         d2[j - 1].shrink_to_fit();

         if (i == n && j > 0) {
            d1[j - 1].clear();
            d1[j - 1].shrink_to_fit();
         }
      }

      d1[m] = d2[m];
      d2[m].clear();
      d2[m].shrink_to_fit();
   }

   delete [] d2;

   if (d1[m].length() > 0) 
      cout << d1[m];
   else
      cout << '\n';

   delete [] d1;

   return 0;
}